import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

  function Projects() {
    return (
      <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh', 
        marginBottom: '10vh',
        width: "100%",
        height: "100vh",
        display: 'flex',
        justifyContent: 'space-between',
      }}
    >
      <h1>Maze Game</h1>
      <Box sx={{ mb: "10px", borderBottom: "2px solid white" }}>
        <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
        </Stack>
      </Box>
    </Container>
    );
  };

  export default Projects;
